import React, { Component } from 'react';
import "./navbar.css";
import { Navbar, NavDropdown, Nav, NavItem, NavLink } from "react-bootstrap";

class Navbarweb extends Component {

    render() {
        return (
            <React.Fragment>

                <Navbar collapseOnSelect expand="lg" bgprefix="bgcolors" style={{ background: 'rgba(3, 163, 128, 0.363)' }} fixed="top" >
                    <div className="container">
                        <Navbar.Brand href="#home"><span style={{ color: 'white' }}>  <Image src={Logo} width='25px' height='auto' />SyLand</span></Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                        <Navbar.Collapse id="responsive-navbar-nav">
                            <Nav className="mr-auto">

                                {/* <Nav.Link href="#features">Features</Nav.Link>
      <Nav.Link href="#pricing">Pricing</Nav.Link>
      <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown> */}
                            </Nav>
                            <Nav>
                                <button className=" btnsetback" onClick={() => { this.showApprove() }} > Approve The Land</button>

                                <button className=" btnsetback" onClick={() => { this.openregisterwindow() }} > Register The Land</button>
                                <button className=" btnsetback" onClick={() => { this.LogOutview() }} > Logout</button>
                                {/* <Nav.Link href="#deets">More deets</Nav.Link> */}
                                <Nav.Link eventKey={2} >


                                </Nav.Link>

                            </Nav>
                        </Navbar.Collapse>
                    </div>
                </Navbar>

            </React.Fragment>
        );
    }


}
export default Navbarweb;
